import React from 'react';
import {useState} from 'react';

function NonNegativeField(field_id, placeholder_text) {
  var [numInput, setValue] = useState(1);
  var checkIfNegative = function() {
    if (numInput < 0) {
      setValue(0);
    }
  }
  return (
    <input
        id={field_id}
        placeholder={placeholder_text}
        type="number"
        value={numInput}
        onChange={checkIfNegative}
    />
  )
}

export default NonNegativeField
